"""![image.png](data:image/png;base64,)

#Scenario 01:

# Task 1: Load a grayscale image of a scanned document
"""

image = cv2.imread('Scanerio 01.png', cv2.IMREAD_GRAYSCALE)  # Load the image in grayscale

plt.imshow(image,cmap='gray')

"""# Task 2: Extract and visualize all 8 bit-planes"""

rows, cols = image.shape
bit_planes = []

for i in range(8):
    bit_plane = (image & (1 << i)) >> i  # Extract the i-th bit-plane
    bit_planes.append(bit_plane * 255)  # Scale the bit-plane to 0-255 range

"""# Visualize all 8 bit-planes"""

fig, axes = plt.subplots(2, 4, figsize=(12, 6))
fig.suptitle("Bit Planes of the Scanned Document", fontsize=16)

for i, ax in enumerate(axes.ravel()):
    ax.imshow(bit_planes[i], cmap='gray')
    ax.set_title(f"Bit Plane {i}")
    ax.axis('off')

plt.tight_layout()
plt.show()

"""# Task 3: Combine higher-order bit planes (e.g., 6th, 7th, and 8th) to create a new enhanced image"""

mask5 = 1 << 4  # 5th bit (bit index starts from 0)
mask6 = 1 << 5  # 6th bit
mask7 = 1 << 6  # 7th bit

bit_plane_5 = cv2.bitwise_and(image, mask5)
bit_plane_6 = cv2.bitwise_and(image, mask6)
bit_plane_7 = cv2.bitwise_and(image, mask7)

combined_planes = cv2.bitwise_or(bit_plane_5, bit_plane_6)
combined_planes = cv2.bitwise_or(combined_planes, bit_plane_7)

# Normalize the combined planes to 0-255 range
combined_bit_planes_scale = cv2.normalize(combined_planes, None, 0, 255, cv2.NORM_MINMAX)

"""
# Display the images"""

plt.figure(figsize=(10, 5))

plt.subplot(1, 2, 1)
plt.title('Original Image')
plt.imshow(image, cmap='gray')
plt.axis('off')

plt.subplot(1, 2, 2)
plt.title('Enhanced Image (Combined Bit Planes)')
plt.imshow(combined_bit_planes_scale, cmap='gray')
plt.axis('off')

plt.show()

