def load_image(image_path):
    image = cv2.imread(image_path, cv2.IMREAD_GRAYSCALE)
    plt.figure(figsize=(6, 6))
    plt.imshow(image, cmap='gray')
    plt.title("Original Image")
    plt.axis("off")
    plt.show()
    return image

def plot_histogram(image, title="Histogram"):
    plt.figure(figsize=(8, 6))
    plt.hist(image.ravel(), bins=256, range=[0,256], color='black', alpha=0.75)
    plt.title(title)
    plt.xlabel("Pixel Intensity")
    plt.ylabel("Frequency")
    plt.show()

def check_exposure(image):
    mean_intensity = np.mean(image)
    if mean_intensity < 128:
        return "Underexposed"
    elif mean_intensity > 128:
        return "Overexposed"
    else:
        return "Well-balanced"

def histogram_stretching(image):
    min_val = np.min(image)
    max_val = np.max(image)
    stretched = ((image - min_val) * (255.0/max_val - min_val))
    return stretched

"""# Load and process the X-ray image (Grey-Scale)"""

image_path = 'Scanerio 02.jpg'
image = load_image(image_path)

# Plot original histogram
plot_histogram(image, "Original Histogram")

"""# Check exposure level"""

exposure_status = check_exposure(image)
print("Exposure Status:", exposure_status)

"""# Histogram stretching"""

enhanced_image = histogram_stretching(image)

plt.imshow(enhanced_image,cmap='gray')

"""# Plot enhanced histogram"""

plot_histogram(enhanced_image, "Enhanced Histogram")

"""# Show original and enhanced images"""

plt.figure(figsize=(10,5))
plt.subplot(1,2,1)
plt.imshow(image, cmap='gray')
plt.title("Original Image")
plt.axis("off")

plt.subplot(1,2,2)
plt.imshow(enhanced_image, cmap='gray')
plt.title("Enhanced Image")
plt.axis("off")

plt.show()

