"""![image.png](data:image/png;base64,)

#Load the night-time image
"""

image = cv2.imread('Scanerio 04.jpg', cv2.IMREAD_GRAYSCALE).astype(np.float32) + 1
plt.imshow(image, cmap='gray')

"""![image.png](data:image/png;base64,)

#Apply log transformation

Converted gray scale image to float type as it was creating an error when log transformation applied.
"""

log_transformed = cv2.normalize(np.log1p(image), None, 0, 255, cv2.NORM_MINMAX, dtype=cv2.CV_8U)

"""![image.png](data:image/png;base64,)

# Apply gamma correction
"""

gamma = 2.2
gamma_corrected = np.array(255 * (image / 255) ** (1 / gamma), dtype='uint8')

"""![image.png](data:image/png;base64,)

# Comparison of all images
"""

plt.figure(figsize=(15,5))

plt.subplot(1,3,1)
plt.imshow(image, cmap='gray')
plt.title('Original Image')
plt.axis('off')

plt.subplot(1,3,2)
plt.imshow(log_transformed, cmap='gray')
plt.title('Log Transformed')
plt.axis('off')

plt.subplot(1,3,3)
plt.imshow(gamma_corrected, cmap='gray')
plt.title(f'Gamma Corrected (γ={gamma})')
plt.axis('off')

plt.show()

